        dtdp = TPC.Get(CCP.idtipodepeca);
    }

    public async Task ApagarComposto(int i)
    {
        CCP.stock = CCP.stock - listaCompras[i - 1].quantidade;
        CAPC.Put(CCP.idproduto, CCP);
        ComprasC.Delete(LCP[i].idcompra, i - 1);
        LCP.RemoveAt(i);

    }


